def check_simpli(id_list):
    profile_col = refer_collection()
    profile_col_min = refer_simplified_dump_col_min()
    for k in id_list:
        if profile_col_min.find({'_id': {"$in": [k]}}).count() == 0:
            profile_col.update_one({'_id': k}, {'$set': {'ignore_flag': '1'}})
            print(k)


def check_links(id_list):
    profile_col = refer_collection()
    for k in id_list:
        prof_data_entry = profile_col.find({"_id": k})
        # print('proj', proj_data_entry)
        prof_data = [i for i in prof_data_entry]
        if('org' in prof_data[0]['link']):
            print(prof_data[0]['link'])
            profile_col.update_one({'_id': k}, {'$set': {'ignore_flag': '1'}})

